import React from "react";
import "../styles/Skills.css";

const Skills = () => {
  return (
    <div className="skills">
      <h1>Skills</h1>
      <ul>
        <li>Web Development (React, Tailwind CSS)</li>
        <li>UI/UX Design</li>
        <li>Firebase, MongoDB</li>
        <li>Mobile App Development (React Native)</li>
      </ul>
    </div>
  );
};

export default Skills;
